import './PerformanceBox.css'

function PerformanceBox(props) {
    console.log(props)
    let inn = props.inn
    let tour = props.tour

    return (
        <div className="summary_innings">
            <Scoreline team={inn.bat_team} score={inn.score} overs={inn.overs} tour={tour} teamname={inn.teamname}/>
            <Wrapper1 batsmen={inn.bat} bowlers={inn.ball} bat_team={inn.bat_team} bow_team={inn.bow_team} tour={tour}/>
        </div>
    )

}
export default PerformanceBox;
